import React from "react";
import styles from "../CSS/component.module.css";
import CloseIcon from "@material-ui/icons/Close";
import { IconButton } from "@material-ui/core";

export const EstimatorEstimate = ({
  taskID,
  taskName,
  taskType,
  submitter,
  turn,
}) => {
  return (
    <div className={styles.popup}>
      <IconButton className={styles.close_btn}>
        <CloseIcon />
      </IconButton>
      <h2>태스크 이름</h2>
      <p>{taskName}</p>
      <h2>태스크 타입</h2>
      <p>{taskType}</p>
      <h2>제출자</h2>
      <p>{submitter}</p>
      <h2>회차</h2>
      <p>{turn}</p>
      <table id="qualitative_test">
        <tr>
          <th>총 튜플 수</th>
          <th>총 중복 튜플 수</th>
          <th>Null Ratio</th>
        </tr>
        <tr>
          <th>100</th>
          <th>5</th>
          <th>0.5</th>
        </tr>
      </table>
    </div>
  );
};
